//import liraries
import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { View, Text, StyleSheet,Image } from 'react-native';
import { Card } from 'react-native-elements/dist/card/Card';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { SafeAreaView } from 'react-native-safe-area-context';

// create a component
const First = () => {
    return (
       <SafeAreaView style={styles.container}>
             <View>
                 <View style={styles.card}>
                     <View style={styles.img}>
                          <Image
                            source={{uri:'https://play-lh.googleusercontent.com/oHQRntEoYcddMoxpBmmrrhtsh8u551MsiEwwJbTjCluIREUuRDNNFRjbjm0b5nCtj5DV'}}

                            style={{height:75,width:150}}
                          />
                     </View>
                     <View style={styles.cardInfo}></View>
                     <TouchableOpacity>
                         <Text>Read</Text>
                     </TouchableOpacity>
                 </View>

             </View>
        </SafeAreaView>
    );
};

// define your styles
const styles = StyleSheet.create({
    container: {
        flex: 1,
    },
    card:{
        height:150,width:150,borderWidth:2,borderRadius:10
    }
    
});

//make this component available to the app
export default First;
